import React,{Component} from 'react';
import 'tachyons';
import './Nav.scss';
import logo from './debuggedlogo.png';

const Nav =({onRouteChange,route})=>
{
    return (
      <div className="topnav">
     <div>
         <div style={{height:'100px', width:'100px'}} className='ma0'>
             <img style={{height:'100%', width:'100%'}} src={logo} alt='Logo'/>
         </div>
     </div>
      &nbsp;
      <ol className="navhead">
      <li  className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')}>About Us</li>
      <li  className={`nav ul f4 ${route==='work'?'active1':'left ul'} mr2.5`} onClick={()=>onRouteChange('work')}>Our work</li>
      <li  className={`nav ul f4 ${route==='contact'?'active1':'left ul'}`} onClick={()=>onRouteChange('contact')}>Contact us</li>
      </ol>
     </div>

    );
  }

export default Nav;

